import React, { useEffect, useState } from "react";

const BACKEND_NEWS_URL = process.env.REACT_APP_BACKEND_NEWS_URL || "http://localhost:4000/api/news";
const BACKEND_PROXY_URL = process.env.REACT_APP_BACKEND_PROXY_URL || "http://localhost:4000/api/vulnerabilities";

export function News() {
  const [newsList, setNewsList] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    async function fetchNews() {
      setLoading(true);
      setError(null);
      try {
        const response = await fetch(BACKEND_NEWS_URL);
        if (!response.ok) throw new Error("Failed to fetch news");
        const data = await response.json();
        setNewsList(data.articles || []);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    }
    fetchNews();
  }, []);

  if (loading) return <p>Loading news...</p>;
  if (error) return <p>Error: {error}</p>;

  return (
    <div>
      <h2>Latest Cybersecurity News</h2>
      {newsList.map((news, i) => (
        <article key={i}>
          <h3>{news.title}</h3>
          <p>{news.description}</p>
          <small>{news.source?.name} | {new Date(news.publishedAt).toLocaleString()}</small>
        </article>
      ))}
    </div>
  );
}

export function Vulnerabilities() {
  const [vulnerabilities, setVulnerabilities] = useState([]);
  const [form, setForm] = useState({ packageName: "jinja2", version: "2.4.1", ecosystem: "PyPI", company: "", severityFilter: "" });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleInputChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const fetchVulnerabilities = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await fetch(BACKEND_PROXY_URL, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(form),
      });
      if (!response.ok) throw new Error("Failed to fetch vulnerabilities");
      const data = await response.json();
      setVulnerabilities(data.vulns || []);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchVulnerabilities();
  }, []);

  return (
    <div>
      <h2>Vulnerabilities</h2>
      <form
        onSubmit={(e) => {
          e.preventDefault();
          fetchVulnerabilities();
        }}
      >
        <input name="packageName" value={form.packageName} onChange={handleInputChange} placeholder="Package Name" required />
        <input name="version" value={form.version} onChange={handleInputChange} placeholder="Version" required />
        <input name="ecosystem" value={form.ecosystem} onChange={handleInputChange} placeholder="Ecosystem" required />
        <input name="company" value={form.company} onChange={handleInputChange} placeholder="Company (optional)" />
        <input name="severityFilter" value={form.severityFilter} onChange={handleInputChange} placeholder="Severity Filter (optional)" />
        <button type="submit">Search</button>
      </form>

      {loading && <p>Loading vulnerabilities...</p>}
      {error && <p>Error: {error}</p>}

      {vulnerabilities.map((vuln, i) => (
        <article key={vuln.id || i}>
          <h3>{vuln.id}</h3>
          <p>{vuln.summary}</p>
          <p>Published: {vuln.published ? new Date(vuln.published).toLocaleDateString() : "N/A"}</p>
        </article>
      ))}
    </div>
  );
}
